function genRandomStableData(num) {
    let res = [[], [], [], []]
    for (let i = 0; i < num; i++) {
        let a = Math.round(Math.random() * 55)
        let b = Math.round(Math.random() * 25)
        let c = Math.round(Math.random() * (100 - a - b))
        let d = 100 - a - b - c
        res[0].push(a)
        res[1].push(b)
        res[2].push(c)
        res[3].push(d)
    }
    return res
}

